    geo_json_de92e19d165146b39752fdc7009a8c66.bindTooltip(
    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature=>typeof(feature)=='object' ? JSON.stringify(feature) : feature;
    let fields = ["co", "no", "no2", "o3", "so2", "pm2_5", "pm10", "nh3"];
    let aliases = ["co", "no", "no2", "o3", "so2", "pm2_5", "pm10", "nh3"];
    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
